class Solution {

    /**
     * @param String $s1
     * @param String $s2
     * @param String $s3
     * @return Integer
     */
    function findMinimumOperations($s1, $s2, $s3) {
        // The approach is to iteratively check each string from the end
        // and find the minimum number of deletions required to make them equal.
        // If at any point the first characters differ, return -1.

        // Initial operation count is 0.
        $operations = 0;

        // Loop until all strings are of length 0.
        while (strlen($s1) > 0 || strlen($s2) > 0 || strlen($s3) > 0) {
            // If any of the strings is empty or they are not all equal,
            // remove the rightmost character from the longer strings.
            if ($s1 === $s2 && $s2 === $s3) {
                // All strings are equal, return operations.
                return $operations;
            }

            // Find the maximum length among the strings.
            $maxLength = max(strlen($s1), strlen($s2), strlen($s3));

            // If s1 is longer than the minimum length, shorten it and increment operations.
            if (strlen($s1) === $maxLength) {
                $s1 = substr($s1, 0, -1);
                $operations++;
            }

            // Repeat for s2.
            if (strlen($s2) === $maxLength) {
                $s2 = substr($s2, 0, -1);
                $operations++;
            }

            // Repeat for s3.
            if (strlen($s3) === $maxLength) {
                $s3 = substr($s3, 0, -1);
                $operations++;
            }
        }

        // If all strings are reduced to empty and they were not equal at some point,
        // it means it was not possible to make them equal, return -1.
        return -1;
    }
}
